import sys
from os import remove
import winsound
import pyHook
import base64
from PyQt5 import QtCore, QtGui, QtWidgets

#GIF image raw data as Base64
data = ""


#wav file raw data as Base64
wvdata = ""




class Ui_MainWindow(object):
    def setupUi(self, MainWindow):
        MainWindow.setObjectName("MainWindow")
        MainWindow.resize(321, 249)
        self.centralwidget = QtWidgets.QWidget(MainWindow)
        self.centralwidget.setObjectName("centralwidget")
        self.label = QtWidgets.QLabel(self.centralwidget)
        self.label.setGeometry(QtCore.QRect(0, 0, 320, 248))
        self.label.setFrameShape(QtWidgets.QFrame.Box)
        self.label.setOpenExternalLinks(False)
        self.label.setTextInteractionFlags(QtCore.Qt.NoTextInteraction)
        self.label.setObjectName("label")
        MainWindow.setCentralWidget(self.centralwidget)

        self.retranslateUi(MainWindow)
        QtCore.QMetaObject.connectSlotsByName(MainWindow)

    def retranslateUi(self, MainWindow):
        _translate = QtCore.QCoreApplication.translate
        MainWindow.setWindowTitle(_translate("MainWindow", "MainWindow"))

class MainWindow(QtWidgets.QMainWindow, Ui_MainWindow):
    def __init__(self, parent=None):
        super(MainWindow, self).__init__(parent)
        self.setupUi(self)
  
        # Plays the movie in the Label
        movie = QtGui.QMovie("giphy.gif")
        self.label.setMovie(movie)
        movie.start()
        
        # Plays the sound with the movie
        winsound.PlaySound("magicwrd.wav", winsound.SND_ASYNC | winsound.SND_LOOP)

#Stops Sound
def StopSound():
    winsound.PlaySound(None, winsound.SND_PURGE)

#Blocks Input when program is launched
def DisableInput(event):
        
    return False


#converts and writes files to disk
with open("giphy.gif", "wb") as fh:
    
    f = base64.b64decode(data)
    fh.write(f)

with open("magicwrd.wav", "wb") as fh:
    
    f = base64.b64decode(wvdata)
    fh.write(f)



if __name__ == "__main__":

    Timer = 3

    #Set up hook for keyboard and mouse
    Hook = pyHook.HookManager()
    Hook.HookMouse()
    Hook.HookKeyboard()
    Hook.MouseAll = DisableInput
    Hook.KeyDown = DisableInput

    #base Window setup
    app = QtWidgets.QApplication(sys.argv)
    w = MainWindow()
    w.show()
    
    #Quits after X amount of time defined by Timer variable
    QtCore.QTimer.singleShot(Timer * 1000, QtCore.QCoreApplication.quit)
    
    #removes both files. Currently there is a conflict preventing GIF from being removed. 
    QtCore.QFile.remove("giphy.gif")
    QtCore.QFile.remove("magicwrd.wav") 
    
    sys.exit(app.exec_())

